window.bookSummaryJSON = "<p><b><i>2014 Winner - Amazon Breakthrough Novel Award - Grand Prize and Mystery &amp; Thriller Fiction Winner</i></b></p> <p>It’s 1998, and for years the old First Bank of Cleveland has sat abandoned, perfectly preserved, its secrets only speculated on by the outside world.&nbsp;</p> <p>Twenty years before, amid strange staff disappearances and allegations of fraud, panicked investors sold Cleveland’s largest bank in the middle of the night, locking out customers and employees, and thwarting a looming federal investigation. In the confusion that followed, the keys to the vault’s safe-deposit boxes were lost.&nbsp;</p> <p>In the years since, Cleveland’s wealthy businessmen kept the truth buried in the abandoned high-rise. The ransacked offices and forgotten safe-deposit boxes remain locked in time, until young engineer Iris Latch stumbles upon them during a renovation survey. What begins as a welcome break from her cubicle becomes an obsession as Iris unravels the bank’s sordid past. With each haunting revelation, Iris follows the looming shadow of the past deeper into the vault - and soon realizes that the key to the mystery comes at an astonishing price.</p>"; 
